  return (
    <div>
      <ul className='text-center'>
        <li>2019-2022 : Adhérent au Conseil d'architecture, d'urbanisme et de l'environnement</li>
        <video src=""></video>
      </ul>
    </div>
  )
}

Curriculum.propTypes = {}

export default Curriculum;
